const mongoose = require("mongoose");

var defaultPicture1 = "";
var defaultPicture2 = "";
var defaultPicture3 = "";
var defaultPicture4 = "";
var defaultPicture5 = "";
var defaultPicture6 = "";
var defaultPicture7 = "";

const oglasSchema = new mongoose.Schema({

    tipObjekta: {
        type: String,
        required: true
    },
    useljivOd: {
        type: Date,
        required: true
    },
    cena: {
        type: Number,
        required: true
    },
    nacinGrejanja: {
        type: String,
        required: false
    },
    slike: [{
        coverImage: {
            type: Buffer,
            required: false
        },
        coverImageType: {
            type: String,
            required: false
        }
    }],
    cimerOrCimerka: {
        type: String,
        required: false
    },
    createdAt: {
        type: Date,
        required: true,
        default: Date.now
    },
    nazivGrada: {
        type: String,
        required: true
    },
    koordinateStana: {
        lat: {
            type: Number,
            required: false,
            default: 0
        },
        lng: {
            type: Number,
            required: false,
            default: 0
        }
    },
    deoGradaOpstina: {
        type: String,
        required: true
    },
    adresa: {
        type: String,
        required: false
    },
    korisnikId: {
        type: mongoose.Schema.Types.ObjectId,
        required: true,
        ref: "Korisnik"
    },
    svrhaOglasa: { //tcis, tcns, izst -> trazimCimera(ImamStan-NemamStan), izdajemStan
        type: String,
        required: true
    },
    vesMasina: {
        type: Boolean,
        required: false
    },
    zamrzivac: {
        type: Boolean,
        required: false
    },
    frizider: {
        type: Boolean,
        required: false
    },
    friziderSaZamrzivacem: {
        type: Boolean,
        required: false
    },
    sporet: {
        type: Boolean,
        required: false
    },
    mikrotalasna: {
        type: Boolean,
        required: false
    },
    kada: {
        type: Boolean,
        required: false
    },
    tusKabina: {
        type: Boolean,
        required: false
    },
    klima: {
        type: Boolean,
        required: false
    },
    tv: {
        type: Boolean,
        required: false
    },
    sank: {
        type: Boolean,
        required: false
    },
    terasa: {
        type: Boolean,
        required: false
    },
    usisivac: {
        type: Boolean,
        required: false
    },
    aspirator: {
        type: Boolean,
        required: false
    },
    mikser: {
        type: Boolean,
        required: false
    },
    escajg: {
        type: Boolean,
        required: false
    },
    posudje: {
        type: Boolean,
        required: false
    },
    defaultCoverImage: {
        type: Buffer,
        required: true,
        default: new Buffer.from(defaultPicture1 + defaultPicture2 + defaultPicture3 + defaultPicture4 + defaultPicture5 + defaultPicture6 + defaultPicture7, "base64")
    },
    defaultCoverImageType: {
        type: String,
        required: true,
        default: "image/png"
    }
});

oglasSchema.virtual("coverImagePath").get(function(){  //kad zovemo coverImagePath, ona ce zvati ovu get metodu
    //console.log("IMA SLIKA!!!");
    var arraySlika = [];
    this.slike.forEach( slika => {
        if (slika.coverImage != null && slika.coverImageType != null){ //nije arow fja, da bismo mogli da koristimo this, koji povezuje book
            arraySlika.push(`data:${slika.coverImageType};charset=utf-8;base64,
            ${slika.coverImage.toString("base64")}`);  
        }
    });
    return arraySlika;
    
});

oglasSchema.virtual("coverImagePathDefault").get(function(){  //kad zovemo coverImagePath, ona ce zvati ovu get metodu
    //console.log("NEMA SLIKA! Znaci default");
    if (this.defaultCoverImage != null && this.defaultCoverImageType != null){ //nije arow fja, da bismo mogli da koristimo this, koji povezuje book
        return `data:${this.defaultCoverImageType};charset=utf-8;base64,
       ${this.defaultCoverImage.toString("base64")}`;  
    }
});


module.exports = mongoose.model("Oglas", oglasSchema);